package com.example.fptacademysystem.dto;import java.io.Serializable;public class RoomDTO implements Serializable {    private int roomid;    private String roomnm;    private String removeat;    public RoomDTO() {        super();    }    public int getRoomid() {        return roomid;    }    public void setRoomid(int roomid) {        this.roomid = roomid;    }    public String getRoomnm() {        return roomnm;    }    public void setRoomnm(String roomnm) {        this.roomnm = roomnm;    }    public String getRemoveat() {        return removeat;    }    public void setRemoveat(String removeat) {        this.removeat = removeat;    }}